									[~Unfortunately, I don't know the details.
I just flew out of there as soon as I could,
looking for anyone who could help.~],
									set(level.player.animation, 'emote_oh'),
									level.player, [~That certainly...
changes my plans for the day.~],
									set(level.player.animation, 'emote_confused'),
