									set(level.player.animation, 'emote_raisedfinger'),
									level.player, [~I don't think I can promise anything,
but if the opportunity presents itself,
who knows?~],
									self, [~Yes, it's unreasonable to expect
someone to just charge in there.~],
									[~I'm at a loss for a plan, myself.~],
									[~Nevertheless, I'd better be going.
